import React from 'react';
import './App.css';

function App() {
  return (
    <div className="box">
          <button>Sign Up</button>
      <button>Log In</button>
      <input class="input" placeholder="First Name*" name="firstname" required></input> 
      <input class="input" placeholder="Last Name*" name="lastname"></input><br></br>
      <input class="input" placeholder="Email Adress" name="email"></input> <br></br>
      <input class="input" placeholder="Set A Password*" name="password"></input>
      <button>GET STARTED</button>
    </div>
  );
}

export default App;
